import React from "react";
import { useLocation } from "react-router-dom";
import Cake from "../assets/birthdaycake.png";

const Event = (props) => {
  console.log(props.location.state);
  return (
    <div className="w-full bg-white">
      <div className="flex flex-col justify-center items-center">
        <img
          src={Cake}
          className="my-4 w-3/4 h-1/2 object-cover rounded-xl"
          alt="/"
        />
      </div>{" "}
      <div className="col-span-2">
        <p className="uppercase text-xl tracking-widest text-[#517be5]">
          {props.location.eventName}
        </p>
        <h2 className="py-4">Who Am I?</h2>
        <p className="py-2 text-gray-600">
          My name&apos;s Ferdous Hossain Fahim. You can call me Ferdous, or Ferd
          for short.
        </p>
        <p className="py-2 text-gray-600"></p>
        <p className="py-2 text-gray-600">{props.location.eventDescription}</p>
        <p className="py-2 text-gray-600">
          Fun Facts: I have two cats, I love painting miniatures and playing the
          guitar.
        </p>
      </div>
    </div>
  );
};

export default Event;
